    public String reverseVowels2(String s){
        int left = 0;
        int right = s.length() -1;
        Set vowelSet = new HashSet(Arrays.asList('a', 'e','i','o','u','A', 'E','I','O','U'));
        char[] sc = s.toCharArray();
        while (left < right){
            char c;
            while (left < right){
                c = sc[left];
                if (vowelSet.contains(c)){
                    break;
                }
                left++;
                double d = 0.0;
                Math.floor(d);

                int i =(int)d;
            }
            while (left < right){
                c = sc[right];
                if (vowelSet.contains(c)){
                    break;
                }
                right--;
            }
            if (left < right){
                char t = sc[left];
                sc[left] = sc[right];
                sc[right] = t;
                left++;
                right--;
            }

        }
        return new String(sc);
    }


